function Rating(props) {
  const { rating, numReviews } = props;
  let stars = '';
  for (var i = 1; i <= 5; i++) {

    stars += (
      <span>
        <i className={
          rating >= i ?
            'fas fa-star'
            : rating >= i + 0.5 ?
              'fas fa-star-half-alt'
              : 'far fa-star'}></i>
      </span>
    )
  }
  return (
    <div className="rating">
      <span>
        <i className={
          rating >= i ?
            'fas fa-star'
            : rating >= i + 0.5 ?
              'fas fa-star-half-alt'
              : 'far fa-star'}></i>
      </span>
    </div>
  );
}

export default Rating;
